s="wordgoodgoodgoodbestword"
words = ["word","good","best","word"]

def check(string,wrd_dic,subL):
    tmp_dic={}
    l=len(string)
    for i in range(0,l,subL):
        word=string[i:i+subL]
        if word in tmp_dic:
            tmp_dic[word]+=1
        else:
            tmp_dic[word]=1
    return wrd_dic==tmp_dic

if not words:
    print ([])

wrd_dic={}
for word in words:
    if word in wrd_dic:
        wrd_dic[word]=wrd_dic[word]+1
    else:
        wrd_dic[word]=1

subL=len(words[0])
strL=len(s)
maxL=subL*len(words)
res=[]
limit=strL-maxL+1
for i in range(limit):
    if check(s[i:i+maxL],wrd_dic,subL):
        res.append(i)

print (res)